import React from "react";
import ProductCard from "../../components/ProductCard/ProductCard";

type Props = {};

const Homepage = (props: Props) => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-3">
          <ProductCard />
        </div>
      </div>
      <div>Homepage</div>;
    </div>
  );
};

export default Homepage;
